To convert text to an editor state: static fromFileData(data) {
    const json = JSON.parse(data);
    const contentState = convertFromRaw(json.contentState);
    const editorState = EditorState.createWithContent(contentState);
    return new Note(editorState, {
      date: json.date,
      id: json.id
    });

To change state in react use an arrow function like: this.setState(prevState => {
      prevState.shownNotes = addNewNoteData(prevState.shownNotes, note);
      prevState.allNotes = addNewNoteData(prevState.allNotes, note);
      return prevState;
    });
